import React, {useState, useEffect} from "react";
import Map from './components/Map.jsx'
import {Outlet} from 'react-router-dom'
import GoogleMapReact from 'google-map-react';
import greenwich_center from "./components/greenwich_center.js";
import mapkey from "./components/mapkey.js";
import styled from 'styled-components';

const Wrapper = styled.main`
  width: 100%;
  height: 100%;
`;


const App = () => {


	return (    

      <Wrapper>
          <GoogleMapReact   bootstrapURLKeys={{mapkey}}
 defaultZoom={10} defaultCenter={greenwich_center} yesIWantToUseGoogleMapApiInternals onGoogleApiLoaded={({ map, maps }) => handleApiLoaded(map, maps)}
 >

          </GoogleMapReact>
      </Wrapper>

	)
}

export default App
